script: |
  super -f text -I q4045.spq | sort > q4045.out

inputs:
  - name: q4045.spq
    data: |
      SELECT DISTINCT - col2 AS col0 FROM tab0 (FORMAT parquet) AS cor0 WHERE NULL BETWEEN + - CAST ( - + col2 AS INTEGER ) + + + col1 - - ( + + 82 ) - + col0 AND - - col1 AND NULL IN ( - col1 );
  - name: tab0

outputs:
  - name: q4045.out
    data: |
